pragma solidity ^0.7.1;
pragma experimental ABIEncoderV2;

library MathStructs {
    struct RateInfo {
        uint256[] rates;
        uint256[] rateDiffs;
        uint256[] amountsInRates;
        uint256[] amountsOutRates;
        uint256 meanRate;
    }

    struct ValueInfo {
        uint256[] values;
        uint256[] inValues;
        uint256[] outValues;
        uint256 totalValue;
        uint256 totalOutValue;
        uint256 totalInValue;
    }

    struct TokenSwapInfo {
        uint128 tokenIndexIn;
        uint128 tokenIndexOut;
        uint256[] amountsIn;
        uint256[] amountsOut;
        uint256[] balances;
    }

    struct BptInfo {
        uint256 bptOut;
        uint256 bptIn;
        uint256 bptTempOut;
        uint256 bptTempIn;
    }
}
